import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

class Contact extends React.Component {
  render() {
    return (
      <div>
        <h1>Contact</h1>

        <div>
          <a target="_blank" href="https://meetflo.zendesk.com/hc/en-us/articles/230425728-Privacy-Policies">Policies</a>
          <Link to={{ pathname: "https://github.com/fernandacajueiro" }} target="_blank" />
          <Icon className="iconify" icon="ion:logo-github" style={ {color: "#212529"} } width="50" height="50" />
        </div>

        <div>
          <Icon className="iconify" icon="ion:logo-linkedin" style={ {color: "#212529"} } width="50" height="50" />
        </div>

        <div>
          <Icon className="iconify" icon="fontisto:email" style={ {color: "#212529"} } width="50" height="50" />
        </div>
      </div>
    )
  }
};

export default Contact;
